import React, { Component } from "react";
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Todo from './components/todo/Todo';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import LoginComponent from "./components/todo/login";
import HeaderComponent from "./components/todo/Header";
import LogoutComponent from "./components/todo/logout";
import FooterComponent from "./components/todo/Footer";
import AuthenticationService from "./components/todo/AuthenticationService";
import AuthenticatedRoute from "./components/todo/AuthenticatedRoute";

class App extends Component {

  render(){       
    return (
      <div className="App">
        { /*<Todo/>*/ }
        <Router>
          <HeaderComponent/>
          <Routes>
            <AuthenticatedRoute path="/" element={<Todo/>}/>
            <AuthenticatedRoute path="/todo" element={<Todo/>}/>
            <Route path="/login" element={<LoginComponent/>}/>
            <AuthenticatedRoute path="/logout" element={<LogoutComponent/>}/>
            <AuthenticatedRoute path="/welcome" element={<Todo/>}/>
          </Routes>
          <FooterComponent/>
        </Router>

      </div>
    );
  }  
}

export default App;
